import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import VolunteerPointsDashboard from './components/VolunteerPointsDashboard';
import AddVolunteerPoints from './components/AddVolunteerPoints';
import CheckVolunteerHistory from './components/CheckVolunteerHistory';
import RewardCheckin from './components/RewardCheckin';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/" component={VolunteerPointsDashboard} />
          <Route path="/add-points" component={AddVolunteerPoints} />
          <Route path="/check-history" component={CheckVolunteerHistory} />
          <Route path="/reward-checkin" component={RewardCheckin} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
